CommonData.BannerCustomCSS:
#onetrust-button-group-parent {
  width: 100% !important;
  height: 40px !important;
  padding: 0 !important;
  padding-left: 18px !important;
}
#onetrust-button-group, .onetrust-banner-options {
  display: flex !important;
  flex-direction: row-reverse !important;
  width: 100% !important;
  height: 100% !important;
  gap: 18px;
  justify-content: flex-end !important;
}
#onetrust-policy-text, #onetrust-accept-btn-handler, #onetrust-pc-btn-handler, #onetrust-reject-all-handler, #onetrust-policy-text a {
  padding: 0 !important;
  font-size: clamp(0.5rem, calc(0.5rem + 0.25vw), 1rem) !important;
  font-weight: 400 !important;
  font-style: normal !important;
  line-height: 130% !important;
  letter-spacing: -0.1px !important;
  color: #000000 !important;
}
#onetrust-accept-btn-handler, #onetrust-pc-btn-handler, #onetrust-reject-all-handler {
  margin: 0 !important;
  text-align: start !important;
  font-weight: 400 !important;
  line-height: 110% !important;
  border: none !important;
  outline: none !important;
  height: 100% !important;
  display: block !important;
  min-width: fit-content !important;
  text-decoration: underline !important;
}
#onetrust-accept-btn-handler, #onetrust-reject-all-handler, #content-preference-link, #onetrust-policy-text a {
  font-weight: 600 !important;
}
#onetrust-pc-btn-handler {
  background-color: var(--onetrust-secondary-button-bg-color) !important;
  color: var(--onetrust-secondary-button-text-color) !important;
  border: none !important;
  max-width: 100% !important;
}

#onetrust-banner-sdk {
  min-height: 80px !important;
  border-radius: 6px !important;
  border: 1px solid #C7C7C7;
  box-shadow: none !important;
  bottom: calc(var(--one-trust-banner-bottom-mobile, 0px) + 10px) !important;
  left: 10px !important;
  width: calc(100vw - 20px - var(--one-trust-banner-right-padding-mobile, 0px)) !important;
  @media (min-width: 760px) {
     left: 40px !important;
     bottom: var(--one-trust-banner-bottom-desktop, 20px) !important;
     width: 31vw !important;
  }
}

#ot-sdk-container {
  height: 100% !important;
}
#onetrust-policy {
  margin: 18px !important;
}
.onetrust-banner-options {
  float: left !important;
  width: fit-content !important;
}
.ot-sdk-container * {
    font-family: "Cash Sans", Sans-serif !important;
}
.ot-bnr-logo {
  display: none;
}
#onetrust-close-btn-container {
    right: 4px !important;
    top: 2px !important;
    position: absolute !important;
    border: none !important;
    outline: none !important;
}
.onetrust-close-btn-ui {
    border: none !important;
    outline: none !important;
}

CommonData.PCCustomCSS:
.ot-acc-grpcntr ot-acc-txt {
  background-color: #ffffff !important;
}
.ot-pc-logo {
  display: none !important;
}
#onetrust-pc-sdk button, .ot-switch-nob {
  outline: none !important;
}
#onetrust-pc-sdk * {
  font-family: "Cash Sans", sans-serif !important;
}
#accept-recommended-btn-handler, .ot-pc-refuse-all-handler, .onetrust-close-btn-handler {
  border-radius: 1000px !important;
}
.ot-always-active {
  color: black !important;
}
#onetrust-pc-sdk .ot-tgl input:checked+.ot-switch .ot-switch-nob {
  background-color: #00E013 !important;
}
